    false,nt"url": null,nt"notes": "NODC Accession 0112267 includes biological,
    chemical, discrete sample, physical and profile data collected from MIRAI in the
    North Pacific Ocean, Sea of Japan and Sea of Okhotsk from 2006-08-01 to 2006-08-20
    and retrieved during cruise MR06-04 Leg 1 and PACIFICA_49NZ20060801. These data
    include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, FLUORESCENCE,
    HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SIGMA-T, SILICATE,
    WATER TEMPERATURE and pH. The instruments used to collect these data include CTD,
    Coulometer for DIC measurement and bottle. These data were collected by Naomi Harada
    of Japan Agency for Marine-Earth Science and Technology (Jamstec) as part of the
    PACIFICA_49NZ20060801 data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an
    international collaborative project for the data synthesis of ocean interior carbon
    and its related parameters in the Pacific Ocean. The North Pacific Marine Science
    Organization (PICES), Section of Carbon and Climate (S-CC) supported the project.",nt"license_title":
